// Optimized GCD using Binary GCD (Stein's) algorithm
// This avoids expensive modulo/subtraction operations and branching
static inline int gcd(int u, int v) {
    int shift;

    if (u == 0) return v;
    if (v == 0) return u;

    // Find the greatest power of 2 dividing both u and v
    for (shift = 0; ((u | v) & 1) == 0; ++shift) {
        u >>= 1;
        v >>= 1;
    }

    // Remove remaining factors of 2 from u
    while ((u & 1) == 0) u >>= 1;

    // From here on, u is always odd
    do {
        // Remove all factors of 2 from v (since u is odd, v must be even)
        while ((v & 1) == 0) v >>= 1;

        // Now u and v are both odd. Swap if necessary so u <= v
        if (u > v) {
            int t = u; u = v; v = t;
        }

        v = v - u; // v is now even
    } while (v != 0);

    return u << shift;
}

